import React, { Component } from 'react';
export default class Car extends Component{
	
	constructor(props) {
		super(props);
		this.state = {
			brand: "Ford",model: "Mustang",color: "red", year: 1964
			
			};
    }
	render() {
    return (
      <div>
        <h1>My Car {this.state.brand} {this.state.model}</h1>
      </div>
    );
	}
}
